import React from "react";
import { Col, Container } from "react-bootstrap";
const Persone = () => {
  const persone = {
    id: 1,
    firstname: "Денис",
    lastname: "Колосун",
    surname: "Петрович",
    img: "15e832ed-fd36-4217-8fd2-b0c8397d7598.jpg",
    updatedAt: "2023-07-29T21:16:29.249Z",
    createdAt: "2023-07-29T21:16:29.249Z",
  };
  return (
    <Container>
      <Col md={4}>
        <image width={300} height={300} src={persone.img} />
      </Col>
      <Col md={4}></Col>
      <Col md={4}></Col>
    </Container>
  );
};

export default Persone;
